import React, { useState } from 'react'

const Menus = () => {
  const [menuSelection, setMenuSelection] = useState("food");

  console.log("Hellooo");
  return (
    <div className="menus-container">
      <h3>Change the menu selection</h3>
      <span className="button-wrapper">
          <button onClick={() => setMenuSelection("food")} >
            <span className="btn-bg"></span>
            <p>Food</p>
          </button>
          <button onClick={() => setMenuSelection("drinks")} >
          <span className="btn-bg"></span>
            <p>Drinks</p>
          </button>
      </span>
      { menuSelection === "food" && <h3>Food Menus</h3> }
      { menuSelection === "drinks" && <h3>Drinks Menus</h3> }
    </div>
  )
}

export default Menus;
